import React, { useEffect, useState } from "react";
import { FetchRecipes } from "../../MockApi";
import rercipesData from "./recipesData.json";
import GridList from "@material-ui/core/GridList";
import GridListTile from "@material-ui/core/GridListTile";
import Card from "@material-ui/core/Card";
import useStyles from "./styles";
import CardMedia from "@material-ui/core/CardMedia";
import CardContent from "@material-ui/core/CardContent";
import CardActions from "@material-ui/core/CardActions";
import IconButton from "@material-ui/core/IconButton";
import Typography from "@material-ui/core/Typography";
import FavoriteIcon from "@material-ui/icons/Favorite";
import ShareIcon from "@material-ui/icons/Share";

function Recipes() {
  const classes = useStyles();
  const baseUri = "https://spoonacular.com/recipeImages/";
  console.log(rercipesData);
  useEffect(() => {
    async function getData() {
      //   FetchRecipes();
    }
    getData();
  }, []);
  return (
    <div>
      <GridList
        cellHeight={400}
        //   className={classes.gridList}
        cols={3}
      >
        {rercipesData.map((recipe) => (
          <GridListTile key={recipe.id}>
            {/* <img src={baseUri + recipe.image} alt={recipe.title} /> */}
            <Card>
              <CardMedia
                className={classes.media}
                image={baseUri + recipe.image}
                title={recipe.title}
              />
              <CardContent>
                <Typography variant="body2" color="textSecondary" component="p">
                  {recipe.title}
                </Typography>
              </CardContent>
              <CardActions disableSpacing>
                <IconButton aria-label="add to favorites">
                  <FavoriteIcon />
                </IconButton>
                <IconButton aria-label="share">
                  <ShareIcon />
                </IconButton>
              </CardActions>
            </Card>
          </GridListTile>
        ))}
      </GridList>
    </div>
  );
}

export default Recipes;
